  const [clToken, setClToken] = useState('');

  ///Eliminamos la verificación del token cargado y cargamos directamente el componente
  useEffect(() => {
    const FObtenerToken = () => {
      const session = window.sessionStorage.getItem("KeySession");
      if (session) {
        try {
          const parsedSession = JSON.parse(session);
          return parsedSession.clToken;
        } catch (error) {
          console.error("Error parsing session storage value:", error);
          return '';
        }
      }
      return '';
    };

    const token = FObtenerToken();
    setClToken(token);
  }, []);

